Weather forecast; 
http://www.jnto.go.jp/weather/eng/index.php
Tsukiji Area;
http://www.jnto.go.jp/eng/location/regional/tokyo/tsukiji.html

In November 2014, the "techniques for making Tesuki Washi" were registered as a UNESCO intangible cultural heritage. Beautiful and strong, light and easy-to-carry Japanese paper and goods made of this craftwork make perfect souvenirs.

More Story;
http://japan-magazine.jnto.go.jp/en/1502_washi.html

Japanese Aizome (indigo dyeing) is characterized by a color that is also known as "Japan Blue." Not only exotic traditional items such as kimonos or shop curtains, but clothing items or goods that are familiar to us and even that famous landmark in Tokyo are related to Aizome!

More Story;
http://japan-magazine.jnto.go.jp/en/1505_aizome.html

